{"command": "
import hashlib
import random
import string

# Generate a random 20-byte prefix
prefix = ''.join(random.choices(string.ascii_letters + string.digits, k=20))
print(f"Prefix: {prefix}")

# Calculate the expected SHA-256 hash
expected_hash = hashlib.sha256(prefix.encode()).hexdigest()[:20]
print(f"Expected hash: {expected_hash}")

# Try inputting the prefix until we find a match
while True:
    try:
        result = subprocess.run(["./handout/pow", "solve"], input=prefix.encode(), check=True, stdout=subprocess.PIPE, stderr=subprocess.PIPE)
        if b"Correct!" in result.stdout:
            print("Solved!")
            break
        else:
            prefix = ''.join(random.choices(string.ascii_letters + string.digits, k=20))
    except subprocess.CalledProcessError as e:
        if b"Incorrect!" in e.stderr:
            prefix = ''.join(random.choices(string.ascii_letters + string.digits, k=20))
        else:
            print(e.stderr)
            break
"}

